description:
Nacho (Fernando Tejero) es fotografo. Pilar periodista (Malena Alterio). Se odian. Sin embargo, tendran que hacerse pasar por una pareja para realizar un reportaje sobre Olmo (Diego Peretti), un guru que resuelve las crisis de pareja haciendo el Camino de Santiago. Durante seis dias de viaje a traves de Galicia, se veran envueltos en todo tipo de situaciones absurdas, delirantes y romanticas... y es que ya se sabe que hasta el final del camino todo puede ocurrir.
Al Final del Camino


